import React, { Component } from "react";
import {
  Dimensions,
  Image,
  FlatList,
  StyleSheet,
  ScrollView,
  TouchableOpacity
} from "react-native";
import * as Icon from "@expo/vector-icons";
import MapView from "react-native-maps";
import { setLocation, setFilters, setCampings } from "../modules/maps";
import { Button, Divider, Input, Block, Text } from "../components";
import { theme, mocks } from "../constants";

const { width, height } = Dimensions.get("window");

class Trip extends Component {

  render() {
    const { product } = this.props;
    return (
      <ScrollView showsVerticalScrollIndicator={false}>

        <Block style={styles.product}>
          <Text h2 bold>
            Plan a Fishing Trip
          </Text>
          {/* <Block flex={false} row margin={[theme.sizes.base, 0]}>
            {product.tags.map(tag => (
              <Text key={`tag-${tag}`} caption gray style={styles.tag}>
                {tag}
              </Text>
            ))}
          </Block> */}
          {/* <Text gray light height={22}>
            {product.description}
          </Text> */}

          <Divider margin={[theme.sizes.padding * 0.9, 0]} />
          <Block>
            <Text semibold>Map</Text>
            <MapView
              style={{ flex: 1 }}
              initialRegion={{
                latitude: 37.78825,
                longitude: -122.4324,
                latitudeDelta: 0.05,
                longitudeDelta: 0.05
              }}
            />
          </Block>
          <Divider margin={[theme.sizes.padding * 0.9, 0]} />

        </Block>
      </ScrollView>
    );
  }
}

Trip.defaultProps = {
  product: mocks.products[0]
};

export default Trip;

const styles = StyleSheet.create({
  product: {
    paddingHorizontal: theme.sizes.base * 2,
    paddingVertical: theme.sizes.padding
  },
  tag: {
    borderColor: theme.colors.gray2,
    borderWidth: StyleSheet.hairlineWidth,
    borderRadius: theme.sizes.base,
    paddingHorizontal: theme.sizes.base,
    paddingVertical: theme.sizes.base / 2.5,
    marginRight: theme.sizes.base * 0.625
  },
  image: {
    width: width / 3.26,
    height: width / 3.26,
    marginRight: theme.sizes.base
  },
  more: {
    width: 55,
    height: 55
  }
});
